userDefinedLinkHintCss:
div > .vimiumHintMarker {
  background: #1F1F28;
  font-size: 12px;
  border: 1px solid #7E9CD8;
  padding: 3px;
  border-radius: 0.34em;
  color: #DCD7BA;
}

/* Link hint text */
div > .vimiumHintMarker span {
  color: #DCD7BA;
  font-size: inherit;
  text-shadow: none;
}

/* Link hint matching characters */
div > .vimiumHintMarker > .matchingCharacter {
  color: #7E9CD8;
}

/* Currently selected/highlighted hint marker */
div > .vimiumActiveHintMarker {
  background: #7E9CD8 !important; /* or your preferred selection color */
  border-color: #7E9CD8 !important;
}

/* Selected hint text */
div > .vimiumActiveHintMarker span {
  color: #1F1F28 !important;
}

/* Selected hint matching characters */
div > .vimiumActiveHintMarker > .matchingCharacter {
  color: #1F1F28 !important;
}
